// based on https://developer.mozilla.org/fr/docs/Web/Web_Components/Using_custom_elements
class RatingStar extends HTMLElement {
    constructor() {
        // Always call super first in constructor
        super();

        // Create a shadow root
        const shadow = this.attachShadow({mode: 'open'});

        // Create div element
        const wrapper = document.createElement('div');
        wrapper.setAttribute('class', 'wrapper');

        // star images
        let imgUrlBlack = 'data:image/png;base64,';
        let imgUrlYellow = 'data:image/png;base64,';
        // Take attribute content and put it inside the info span
        let text = this.getAttribute('data-rating');

        let dif = 5 - text;
        var html = "";
        if (text <= 5) {
            for (let i = 0; i < text; i++) {
                html += "<img width='50px' src='" + imgUrlYellow + "' alt='rating yellow star" + i + "' />";
            }
        } else {
            console.log("Error: data-rating must be an int and the value should be less or equal to 5 ")
        }
        if (dif > 0) {
            for (let j = 0; j < dif; j++) {
                console.log(j);
                html += "<img width='50px' src='" + imgUrlBlack + "' alt='rating black star" + j + "' />";
            }
        }
        const style = document.createElement('style');

        style.textContent = `
      .wrapper {
        position: relative;
        display: inline-block;
      }
    `;
        // Attach the created elements to the shadow dom
        shadow.appendChild(style);
        // Attach the created elements to the shadow dom
        shadow.appendChild(wrapper);
        wrapper.innerHTML = html;
    }
}

// Define the new element
customElements.define('rating-star', RatingStar);
